import { StyleSheet } from 'react-native';


const styles = StyleSheet.create({
    statusbar:{
        backgroundColor:'blue'
    },
    appScreen: {
        paddingTop: 25,
        flex:1,
        height:'100%',
        justifyContent:'center',
        alignItems:'center',
        backgroundColor:'white',
    },
    formView:{
        width:'90%',
        flex:1,
    },
    formInput:{
        borderWidth: 1,
        borderColor:'#C3E0E5',
        marginTop:'5%',
        padding:20,
        borderRadius:4,
        alignItems:'center',
    },
    formBtn:{
        backgroundColor:'#274472',
        borderWidth: 1,
        borderColor:'#C3E0E5',
        marginTop:'5%',
        padding:20,
        borderRadius:4,
        alignItems:'center',
        marginBottom:'10%'
    },
    formBtnText:{
        color:'white',
        textAlign:'center',
        fontSize:16,
    },
    formLink:{
        marginTop:20,
    },
    nameTouch:{
        backgroundColor:'#C3E0E5',
        width:'90%',
        marginTop:'5%',
        padding:20,
        borderRadius:4,
        alignItems:'center',
    },
    touchables:{
        fontSize:16,
        color:'#274472',
    }
});


export { styles }
